CREATE TABLE IF NOT EXISTS `Genes` (
  `WormBaseID` VARCHAR(45) NOT NULL,
  `LocusID` VARCHAR(45) NULL,
  `TranscriptID` VARCHAR(45) NULL,
  `Chr` VARCHAR(45) NULL,
  `Start` VARCHAR(45) NULL,
  `End` VARCHAR(45) NULL,
  `Strand` VARCHAR(45) NULL,
  `InOperon` VARCHAR(45) NULL DEFAULT 'FALSE',
  PRIMARY KEY (`WormBaseID`),
  UNIQUE INDEX `WormBaseID_UNIQUE` (`WormBaseID` ASC))
ENGINE = InnoDB;





CREATE TABLE IF NOT EXISTS `sgRNAs` (
  `PoolSeqID` VARCHAR(45) NOT NULL,
  `WormBaseID` VARCHAR(45) NULL,
  `Type` VARCHAR(45) NULL,
  `Chr` VARCHAR(45) NULL,
  `Start` VARCHAR(45) NULL,
  `End` VARCHAR(45) NULL,
  `Strand` VARCHAR(45) NULL,
  `Sequence` VARCHAR(45) NULL,
  `Promoter` VARCHAR(45) NULL,
  `crRNA` VARCHAR(45) NULL,
  `PrimerF` VARCHAR(45) NULL,
  `PrimerR` VARCHAR(45) NULL,
  PRIMARY KEY (`PoolSeqID`),
  UNIQUE INDEX `PoolSeqID_UNIQUE` (`PoolSeqID` ASC))
ENGINE = InnoDB;


